// page5.component.ts
import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { LoginService } from '../login.service';

@Component({
  selector: 'app-page5',
  templateUrl: './page5.component.html',
  styleUrls: ['./page5.component.css']
})
export class Page5Component implements OnInit {
  userId: string = '1'; // Örnek kullanıcı ID'si, gerçek ID ile değiştirin

  constructor(private loginService: LoginService, private router: Router) {}

  ngOnInit(): void {
    // Diğer başlangıç kodları
  }

  handleButtonClick(buttonName: string): void {
    // Buton tıklama verilerini backend'e gönderin
    this.loginService.recordButtonClick(this.userId, buttonName).subscribe(response => {
      console.log('Buton tıklama kaydedildi:', response);
    }, error => {
      console.error('Buton tıklama kaydedilemedi', error);
    });
  }

  navigateToPage(page: string): void {
    this.router.navigate([`/${page}`]);
  }

  logout(): void {
    // Çıkış yapma işlemleri
    console.log('Çıkış yapılıyor...');
  }
}
